import BlogList from './BlogList';
import useFetch from './useFetch';

const Programming = () => {
    const { data: blogs, isPending, error } = useFetch('http://localhost:8000/blogs');

    return (

    <div>
            <div className="sidepanel">
        <ul>
          <h2>Languages</h2>
          <li>
            <a href="/studyplanet/javascript">JavaScript</a>
          </li>
          <li>
            <a href="/studyplanet/css">CSS</a>
          </li>
          <li>
            <a href="/studyplanet/html">HTML</a>
          </li>
          <li>
            <a href="/studyplanet/python">Python</a>
          </li>
          <li>
            <a href="/studyplanet/react">React</a>
          </li>
          <li>
            <a href="/studyplanet/flask">Flask</a>
          </li>
        </ul>
      </div>

    <div className="home">
    <h1>Programming</h1>
    { error && <div>{ error }</div>}
    { isPending && <div>Loading Entries...</div>}
    {/* This blogs && says validate the left before the right. So, it does not output the second part unless the left part = true */}
    {blogs && <BlogList blogs={blogs.filter((blog) => blog.category=== 'Programming')}/>}

    </div>

    </div>
    );
};

export default Programming;
